import React from "react";

import { Card, Avatar, Button } from "antd";

const Profile = () => {
  return (
    <div>
      <Card
        actions={[
          <div key="first">first</div>,
          <div key="second">following</div>,
          <div key="third">follower</div>,
        ]}
      >
        <Card.Meta avatar={<Avatar>HY</Avatar>} title="HeeYeon.K" />
        <Button>로그아웃</Button>
      </Card>
    </div>
  );
};

export default Profile;
